        console.log('Leaflet version:', L.version);
        
        // Initialize map
        const map = L.map('map').setView([37.8816, -121.9142], 12);
        
        // Basemap
        L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Topo_Map/MapServer/tile/{z}/{y}/{x}', {
            maxZoom: 18
        }).addTo(map);
        
        // Hillshade
        const hillshade = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/Elevation/World_Hillshade/MapServer/tile/{z}/{y}/{x}', {
            opacity: 0.3,
            maxZoom: 18
        }).addTo(map);
        
        const dayColors = {
            1: '#E74C3C', 2: '#3498DB', 3: '#9B59B6', 4: '#F39C12'
        };
        
        // Main trail routes
        const mainTrails = L.geoJSON(ALL_DAYS_DATA, {
            style: function(feature) {
                const day = feature.properties.Day || 1;
                return {
                    color: dayColors[day],
                    weight: 4,
                    opacity: 0.9,
                    dashArray: '10, 5'
                };
            }
        }).addTo(map);
        
        // Check if setText is available
        console.log('setText available?', typeof L.Polyline.prototype.setText);
        
        // Trail labels with curved text
        const labelLayers = [];
        const trailLabelsGroup = L.layerGroup().addTo(map);
        
        // Wait for map to load, then add labels
        setTimeout(function() {
            TRAIL_LABELS_DATA.features.forEach(function(feature) {
                const name = feature.properties.ROUTENAME;
                const day = feature.properties.Day;
                const coords = feature.geometry.coordinates;
                
                // Convert coordinates to Leaflet format
                let latlngs;
                if (feature.geometry.type === 'LineString') {
                    latlngs = coords.map(c => [c[1], c[0]]);
                } else if (feature.geometry.type === 'MultiLineString') {
                    latlngs = coords[0].map(c => [c[1], c[0]]);
                }
                
                if (latlngs) {
                    // Create invisible polyline for label
                    const labelLine = L.polyline(latlngs, {
                        color: dayColors[day],
                        weight: 0,
                        opacity: 0
                    }).addTo(trailLabelsGroup);
                    
                    // Try to add text
                    try {
                        if (typeof labelLine.setText === 'function') {
                            labelLine.setText('  ' + name + '  ', {
                                repeat: false,
                                center: true,
                                offset: 8,
                                attributes: {
                                    'font-size': '11',
                                    'font-style': 'italic',
                                    'font-weight': 'bold',
                                    'fill': '#5D4037',
                                    'stroke': 'white',
                                    'stroke-width': '3',
                                    'paint-order': 'stroke',
                                    'stroke-linejoin': 'round'
                                }
                            });
                            console.log('‚úì Added curved label:', name);
                            labelLayers.push(labelLine);
                        } else {
                            console.error('setText not a function for:', name);
                        }
                    } catch(e) {
                        console.error('Error adding label for', name, ':', e);
                    }
                }
            });
            
            console.log('Total labels added:', labelLayers.length);
        }, 500);
        
        // Zoom to trails
        map.fitBounds(mainTrails.getBounds());
        
        // Toggle controls
        document.getElementById('toggle-trails').addEventListener('change', function(e) {
            if (e.target.checked) map.addLayer(mainTrails);
            else map.removeLayer(mainTrails);
        });
        
        document.getElementById('toggle-labels').addEventListener('change', function(e) {
            if (e.target.checked) map.addLayer(trailLabelsGroup);
            else map.removeLayer(trailLabelsGroup);
        });
        
        document.getElementById('toggle-hillshade').addEventListener('change', function(e) {
            hillshade.setOpacity(e.target.checked ? 0.3 : 0);
        });
        
        console.log('Map initialization complete');
    </script>
